import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "./App.css";

export default function App() {
  return (
    <Router>
      <div>
        <nav className="madiv">
          <ul>
            <li>
              <Link to="/">HOME</Link>
            </li>
            <li>
              <Link to="/about">ABOUT ME</Link>
            </li>
            <li>
              <Link to="/resume">RESUME</Link>
            </li>
            <li>
              <Link to="/portfolio">PORTFOLIO</Link>
            </li>
            <li>
              <Link to="/blog">BLOG</Link>
            </li>
            <li>
              <Link to="/contact">CONTACT</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/">
            <Home />
          </Route>

          <Route path="/about">
            <About />
          </Route>

          <Route path="/resume">
            <Resume />
          </Route>

          <Route path="/portfolio">
            <Portfolio />
          </Route>

          <Route path="/blog">
            <Blog />
          </Route>

          <Route path="/contact">
            <Contact />
          </Route>


        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div className="accueil">
      <h4>Hello, I am </h4>
      <h2>AMRI</h2>
      <h4>
        I am
        <strong className="typist-element">
          {" "}
          Developer Web. Passionate about IT .
        </strong>
      </h4>
    </div>
  );
}

function About() {
  return <h2>Hello About</h2>;
}

function Resume() {
  return <h2>Resume</h2>;
}

function Portfolio() {
  return <h2>portfolio</h2>;
}

function Blog() {
  return <h2>blog</h2>;
}

function Contact() {
  return <h2>contact</h2>;
}
